import React from "react";

function ProductoIndividual({ producto }) {
  return (
    <div className="container">
      <div className="row">
        <div className="col-sm-6 offset-3">
          <ul>
            {producto.map(productos>{})}
            <li key={producto._id} className="list-group-item">{producto.nombre}</li>
            <li key={producto._id} className="list-group-item">{producto.descripcion}</li>
            <li key={producto._id} className="list-group-item">{producto.precio}</li>
          </ul>
          <button className="btn btn-success"> Editar</button>
          <button className="btn btn-danger"> Borrar</button>
          <hr className="mt-4"></hr>
        </div>
      </div>
    </div>
  );
}

export default ProductoIndividual;
